icu:ruleBasedNumberFormats.icu:ruleBasedNumberFormat:
%simplified:
    -x: minus >>;
    x.x: << point >>;
    zero; one; two; three; four; five; six; seven; eight; nine;
    ten; eleven; twelve; thirteen; fourteen; fifteen; sixteen;
        seventeen; eighteen; nineteen;
    20: twenty[->>];
    30: thirty[->>];
    40: forty[->>];
    50: fifty[->>];
    60: sixty[->>];
    70: seventy[->>];
    80: eighty[->>];
    90: ninety[->>];
    100: << hundred[ >>];
    1000: << thousand[ >>];
    1,000,000: << million[ >>];
    1,000,000,000: << billion[ >>];
    1,000,000,000,000: << trillion[ >>];
    1,000,000,000,000,000: =#,##0=;
%default:
    -x: minus >>;
    x.x: << point >>;
    =%simplified=;
    100: << hundred[ >%%and>];
    1000: << thousand[ >%%and>];
    100,000>>: << thousand[>%%commas>];
    1,000,000: << million[>%%commas>];
    1,000,000,000: << billion[>%%commas>];
    1,000,000,000,000: << trillion[>%%commas>];
    1,000,000,000,000,000: =#,##0=;
%%and:
    and =%default=;
    100: =%default=;
%%commas:
    ' and =%default=;
    100: , =%default=;
    1000: , <%default< thousand, >%default>;
    1,000,000: , =%default=;%%lenient-parse:
   & << ' ' << ',' << '-';

%with-words:
    0 seconds; 1 second; =0= seconds;
    60/60: <%%min<[, >>];
    3600/60: <%%hr<[, >>>];
%%min:
    0 minutes; 1 minute; =0= minutes;
%%hr:
    0 hours; 1 hour; =0= hours;
%in-numerals:
    =0= sec.;
    60: =%%min-sec=;
    3600: =%%hr-min-sec=;
%%min-sec:
    0: :=00=;
    60/60: <0<>>;
%%hr-min-sec:
    0: :=00=;
    60/60: <00<>>;
    3600/60: <#,##0<:>>>;
%%lenient-parse:
    & ':' = '.' = ' ' = '-';
